import { ModalController, NavController } from '@ionic/angular';
import { Component, OnInit } from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { HttpClient, HttpHeaders } from '@angular/common/http';

@Component({
  selector: 'app-modal-permissao',
  templateUrl: './modal-permissao.page.html',
  styleUrls: ['./modal-permissao.page.scss'],
})
export class ModalPermissaoPage implements OnInit {

  // banco de dados
  nome: any;
  email: any;
  senha: any;
  criarNew: any;
  acessPermissao: any;
  dados: any;

  public fGroupPermissao: FormGroup;

  constructor(
    private modalCtrl: ModalController,
    private fBuilder: FormBuilder
  ) {
    this.fGroupPermissao = this.fBuilder.group({
      'nome': [null,
        Validators.compose([
        Validators.required,
        Validators.minLength(2),
        Validators.maxLength(100),
      ])
      ],
      'emailPermissao': [null,
        Validators.compose([
          Validators.required,
          Validators.pattern(
            /^[a-zA-Z0-9.!#$%&'*+\/=?^_`{|}~-]+@[a-zA-Z0-9](?:[a-zA-Z0-9-]{0,61}[a-zA-Z0-9])?(?:\.[a-zA-Z0-9](?:[a-zA-Z0-9-]{0,61}[a-zA-Z0-9])?)*$/
          ),
          Validators.minLength(4),
          Validators.maxLength(100),
        ])
      ],
      'criarNew': [null],
      'acessPermissao': [null]
    })
  }

  close() {
    this.modalCtrl.dismiss();
  }

  async novaPermissao(){
    //console.log(this.fGroupPermissao.value)

    const nome = this.fGroupPermissao.value.nome;
    const senha = this.fGroupPermissao.value.senha;

    const url = `http://localhost/classes/validationLoguin.php?email=${email}&senha=${senha}`;
  }

  ngOnInit() {
  }

}
<ion-content [fullscreen]="true">
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back-outline" style="color: black;" (click)="close()"></ion-icon>
      <div id="logo">
        <img src="assets/icon/moio.png" alt="" />
      </div>
      <div></div>
    </div>
  </div>

  <form [formGroup]="fGroupPermissao">
    <div id="textPermissao">
      <h1>Nova Permissão</h1>
      <p>Registre funções na sua conta para facilitar a organização.</p>
      <div id="informacoes">
        <ion-input label="Nome" formControlName="nome" labelPlacement="floating" [counter]="true" maxlength="40" helperText="Digite seu Nome"></ion-input>
        <div *ngIf="fGroupPermissao.controls['nome'].errors">
          <p *ngIf="fGroupPermissao.controls['nome'].errors['minLength']">Este campo tem que ter mais de 2 caracteres!</p>
          <p *ngIf="fGroupPermissao.controls['nome'].errors['maxLength']">Este campo tem que ter menos de 100 caracteres!</p>
        </div>
        <ion-input type="email" formControlName="emailPermissao" fill="solid" label="Email" labelPlacement="floating" helperText="Digite um E-mail valido" errorText="E-mail Invalido" ngModel email></ion-input>
        <div *ngIf="fGroupPermissao.controls['emailPermissao'].errors">
          <p *ngIf="fGroupPermissao.controls['emailPermissao'].errors['pattern']">Este campo não está correto!</p>
          <p *ngIf="fGroupPermissao.controls['emailPermissao'].errors['maxLength']">Este campo deve ter menos que 100 caracteres!</p>
        </div>
      </div>
      <div id="funcoes">
        <h1>Funções</h1>
        <div id="selectsFuncoes">
          <ion-checkbox name="criar" formControlName="criarNew">Criar novo local</ion-checkbox><br>
          <ion-checkbox name="acess" formControlName="acessPermissao">Acessar permissões</ion-checkbox>
        </div>
      </div>
    </div>
  <ion-button shape="round" name="enviar" (click)="novaPermissao()">Enviar Solicitação de permissão</ion-button>

